import React from 'react'
import './insect_type.css'

const Insect_type = () => {
  return (
    <div className='insect_type'>
      <div className='circlier_number'>1</div>
      <div className='connector'></div>
      <button>Select Insect</button>
    </div>
  )
}

export default Insect_type
